import { Toolbar, Typography, AppBar, Header, PropTypes, withStyles } from '@material-ui/core';

const styles = {
    root: {
      flexGrow: 1
    },
    typography: {
  flexGrow: 1,
      align: "center"
    }
  };
  
  function TopBar(props) {
    const { classes } = props;
  
    return (
      <div className={classes.root}>
        <AppBar>
          <Toolbar>
            <Typography
              variant="h6"
              color="inherit"
              className={classes.typography}
            >
              Header
            </Typography>
          </Toolbar>
        </AppBar>
      </div>
    );
  }
  
  Header.propTypes = {
    classes: PropTypes.object.isRequired
  };
  
  export default withStyles(styles)(Header);
